$templateCache.put("scripts/core/submissions/submissions.html","<div class=\"container\">\n   <h1 class=\"text-center title\">LE MAT SUBMISSION GUIDELINES</h1>\n   <br>\n   <p class=\"about-text\">There <del>are two ways</del> is one way to send submissions:</p>\n   <ul>\n      <li class=\"about-text\"><del>Via our <a ui-sref=\"main.submissions-form\">online submission form</a>: <a ui-sref=\"main.submissions-form\">link</a></del> (our in browser text editor broke with the last upgrade and we owe Amazon webservices $24,000 in EC2 fees)</li>\n      <li class=\"about-text\">Via our email address at <a href=\"mailto:lematjournal@gmail.com\">lematjournal@gmail.com</a></li>\n   </ul>\n   <p class=\"about-text\">If you decide to submit via email then please use the following guidelines:</p>\n   <ul>\n      <li class=\"about-text\">In your email include a short description of your work, the name (your name) with which you wish to be credited and any other information you would like to share about you or your piece. Optionally you may include any hashtag catagories you would like to associate with your piece.</li>\n      <li class=\"about-text\">For written work we will accept the following:</li>\n      <blockquote>\n         <ul>\n            <li class=\"about-text\">1 to 5 poems</li>\n            <li class=\"about-text\">Weird short stories/experimental fiction.</li>\n            <li class=\"about-text\">Critical works (art criticism, philosophy, literary theory/analysis, art history, knickknacks) of 1000 to 3000 words. Please use MLA format for footnoting, etc.</li>\n            <li class=\"about-text\">Feel free to submit longer works, however, shorter pieces work better with our format.</li>\n         </ul>\n      </blockquote>\n      <li class=\"about-text\">Please use the \".docx\" file type for your submission and include all the works you are submitting in a single document.</li>\n      <li class=\"about-text\">For visual art we will accept 1 to 5 images of 10mb or less in any file type. Final proportions are to be determined mostly by our format and printing/cost constraints. We accept all species of photography and digital art. All submissions should be captioned in the following format:\n         <br>\n         <blockquote class=\"about-text\">Artist, title, date, medium, and dimensions followed by the museum/collection, city, copyright and any other photo credits. There is no terminal period unless the basic caption information is followed by a descriptive sentence. Complete information on medium, dimensions, and collection should be provided if possible. Proper copyright information is manditory if the work is copy protected.</blockquote>\n      </li>\n      <li class=\"about-text\">For video art please upload your work to YouTube and submit using our online submission form. Please follow the above citation style.\n      </li>\n   </ul>\n   <p style=\"font-size: 16px\" class=\"pull-right\">- The Editors</p>\n</div>\n");
